  world: "Monde"
  title: "Countrypedia, l'encyclopedie du tourisme"
  about: "à propos"
  keywords: "countrypedia,encyclopedie du tourisme,apprendre,decouvrir,mashup,voyage,guide de voyage,destination,information,donnees,pays,monde,terre,europe,asie,amerique,afrique,oceanie"
  description: "Countrypedia, l'encyclopédie du tourisme, est votre point de départ pour préparer votre prochain voyage et a des données sur tous les pays du monde. Countrypedia va vous permettre d'apprendre des informations intéressantes (histoire, géographie, culture, ...) et utiles (taux de change, météo, ...) sur votre prochaine destination . Il aggrège différentes sources de données, mises à jour en temps réel, et est disponible dans plusieurs langues. Countrypedia fonctionne aussi sur votre mobile."

